import React from "react";
import "./App.css";

const App = () => {
  return (
    <div className={styles.rootLayout}>
      <h3 className={styles.tabName}>{tabName}</h3>
      <div className={styles.outlet}>
        <Outlet />
        {children}
      </div>
      <GNB />
    </div>
  );
};

export default App;
